import axios from 'axios'
import AuthenticationService from "./AuthenticationService";

const LOCALHOST = 'http://localhost:8080'
const STUDENT_URL = `${LOCALHOST}/students`


class StudentService {
    getStudentProjects() {
        const header = AuthenticationService.authHeader()
        return axios({
            method: 'get',
            header: header,
            url: `${STUDENT_URL}/projects`
        });
    }

    applyProjectById(id) {
        const token = AuthenticationService.authHeader();
        const header =  {
            Authorization: token,
            'Access-Control-Allow-Origin' : '*',
            'Access-Control-Allow-Methods' : 'GET,PUT,POST,DELETE,PATCH',
        }
        return axios({
            method: 'post',
            data: {
                id: id
            },
            headers: header,
            url: `${STUDENT_URL}/projects/application`
        });
    }

    getUserProfile() {
        const token = AuthenticationService.authHeader();
        const header =  {
            Authorization: token,
            'Access-Control-Allow-Origin' : '*',
            'Access-Control-Allow-Methods' : 'GET,PUT,POST,DELETE,PATCH',
        }
        return axios({
            method: 'get',
            headers: header,
            url: `${STUDENT_URL}/info`
        });
    }

    updateStudentProfile(values) {
        const token = AuthenticationService.authHeader();
        const header =  {
            Authorization: token,
            'Access-Control-Allow-Origin' : '*',
            'Access-Control-Allow-Methods' : 'GET,PUT,POST,DELETE,PATCH',
        }
        const first_name = values.first_name;
        const fist_last = values.last_name;
        const phone = values.phone;
        const university = values.university;
        const data = {
            firstName: first_name,
            lastName: fist_last,
            university
        }
        return axios({
            method: 'path',
            headers: header,
            url: `${STUDENT_URL}/info`
        });
    }


}

export default new StudentService();
